import Link from 'next/link';

const Navbar = () => {
    return (
        <nav>
            <style jsx>{`
                ul {
                    list-style: none;
                    display: inline-block;
                    float:right;
                }

                li {
                    display: inline;
                }

                a {
                    padding: 15px 10px;
                    max-width: 100px;
                }
            `}</style>

            <ul>
                <li>
                    <Link href="/">Home</Link>
                </li>
                <li>
                    <a href="https://github.com/reecerussell">Github</a>
                </li>
                <li>
                    <Link href="/Projects">Projects</Link>
                </li>
            </ul>
        </nav>
    );
}

export default Navbar;
